import React from 'react';
import './student.css';

class Student extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
           <div className='main'>
          <div className='search'><input type='search' placeholder='Search'/></div>
          <form className='form'>
          <label>Name</label>
          <input type='text' required name="name" style={{marginLeft:'15%'}}/>
          </form>
           </div>
        )
    }
}
export default Student;
